import React, { Component } from "react";
import { withRouter } from "react-router-dom";


class ThankYou extends Component {

  render() {
    return (
      <div className="appWrapper dashboard-wrapper">
        <div className="appMainWrapper">
          <div className="appMain-container">
            <h1>Thank You !</h1>
            <h3>Bellow is the data that you entered</h3>
            <p><b>Frist Name: </b>{this.props.location.state.fristname}</p>
            <p><b>Last Name: </b>{this.props.location.state.lastname}</p>
            <p><b>Email id:</b> {this.props.location.state.email}</p>
            <p><b>Password: </b>{this.props.location.state.password}</p>
            <p><b>Address: </b>{this.props.location.state.address}</p>
          </div>
        </div>
      </div>
    );
  }
}

export default withRouter(ThankYou);
